(ns crp-mixture
  (:use [embang runtime emit]
        [mrepl core]
        [gorilla-plot core])
  (:require [embang.core]
              [clojure.core.matrix :as m]
              [clojure.core.matrix
                :refer [identity-matrix mmul add sub transpose]
                :rename {identity-matrix eye
                         add madd
                         sub msub
                         transpose mtranspose}]
              [embang.runtime :refer [log-gamma-fn defproc]]
              [clojure.core.matrix.linear :as ml]
              clojure.string))
