;; **
;;; Define CRP wrapper to use CRPs in a "natural" way
;; **

;; @@
; From here: https://bitbucket.org/dtolpin/embang/src/905018d613263bd52ce7d33ddbfd64fde68381b0/code/src/anglib/crp.clj?at=master

(defun crp (alpha)
  (let ((name (gensym "crp")))
    (lambda ()
      (let ((p (or (retrieve name) (CRP alpha)))
            (s (sample (produce p))))
        (store name (absorb p s))
        s))))

