;; **
;;; Define distributions
;; **

;; @@
(defn continuous-chi-squared
  [nu]
  (let
    [
     ; Chi-Squared(nu) ~ Gamma(shape = nu / 2, scale = 2.0).
     ; In Colt library Gamma is parametrised in its second argument
     ; by rate, where scale = 1 / rate.
     gamma-dist (gamma (* nu 0.5) 0.5)]
  (reify distribution
    (sample [this]
      (sample gamma-dist))
    (observe [this value]
      (+
        (* (- (* nu 0.5) 1) (log value))
        (* -0.5 value)
        (* -0.5 nu (log 2))
        (* -1.0 (log-gamma-fn (* 0.5 nu))))))))

(defn multivariate-t
  "Multivariate T-distribution."
  ; Implemented according to http://en.wikipedia.org/wiki/Multivariate_t-distribution
  [nu mu Sigma]
  (let
    [p (first (m/shape Sigma))
     mvn-dist (mvn (vec (repeat p 0)) Sigma)
     chi-squared-dist (continuous-chi-squared nu)]
    (reify distribution
      (sample [this]
              (let
                [y (sample mvn-dist)
                 u (sample chi-squared-dist)]
                (m/add
                 (m/mul y (sqrt (/ nu u)))
                 mu)))
      (observe [this value]
               (-
                (log-gamma-fn (* 0.5 (+ nu p)))
                (+
                 (log-gamma-fn (* 0.5 nu))
                 (* 0.5 p (log nu))
                 (* 0.5 p (log Math/PI))
                 (* 0.5 (log (m/det Sigma)))
                 (* 0.5 (+ nu p)
                    (log
                     (+ 1.0
                        (* (/ 1.0 nu)
                           (m/mmul
                            (m/transpose (m/sub value mu))
                            (m/inverse Sigma)
                            (m/sub value mu))))))))))))

(defn mvn-conjugate-fast-posterior-predictive
  [mu kappa nu Psi N samples-sum samples-squared-sum]
  (let
    [p (first (m/shape Psi))
     samples-mean (if (> N 0) (m/mul (/ 1.0 N) samples-sum) (repeat p 0.0))
     samples-unnorm-cov
       (if (> N 0)
         (m/add
           (m/mul (/ 1.0 N) samples-squared-sum)
           (m/mul (/ -1.0 (* N N))
                  (m/mmul
                    (produce-matrix-from-vector samples-sum)
                    (m/transpose (produce-matrix-from-vector samples-sum)))))
         (repeat p (repeat p 0.0)))
     samples-mean-minus-mu (produce-matrix-from-vector (m/sub samples-mean mu))
     mu-prime (m/add
               (m/mul (/ kappa (+ kappa N))
                      mu)
               (m/mul (/ 1.0 (+ kappa N))
                     samples-sum))
     kappa-prime (+ kappa N)
     nu-prime (+ nu N)
     Psi-prime
     (m/add
      Psi
      samples-unnorm-cov
      (m/mul
       (/ (* kappa N) (+ kappa N))
       (m/mmul
        samples-mean-minus-mu
        (m/transpose samples-mean-minus-mu))))]
    [(- nu-prime (dec p))
     mu-prime
     (m/mul
      (/ (+ kappa-prime 1) (* kappa-prime (- nu-prime (dec p))))
      Psi-prime)]))

(defproc mvn-conjugate-fast
  "Multivariate normal with unknown mean and covariance matrix."
  [mu kappa nu Psi]
  [N 0
   samples-sum (repeat (first (m/shape Psi)) 0)
   samples-squared-sum (m/matrix (repeat (first (m/shape Psi)) (repeat (first (m/shape Psi)) 0)))]
  (produce [this]
           (apply
            multivariate-t
            (mvn-conjugate-fast-posterior-predictive mu kappa nu Psi N samples-sum samples-squared-sum)))
  (absorb [this sample]
          (let
            [sample-as-matrix (produce-matrix-from-vector sample)]
            (mvn-conjugate-fast
             mu kappa nu Psi
             (inc N)
             (m/add samples-sum sample)
             (m/add samples-squared-sum (m/mmul sample-as-matrix (m/transpose sample-as-matrix)))))))

