;; **
;;; Define hyper-parameters for our Normal-inverse-Wishart prior for Multivariate normal distribution with unknown mean and covariance
;; **

;; @@
(def mu-0 [0 0])
(def k-0 0.05)
(def nu-0 60)
(def Lambda-0 [[5 0] [0 5]])

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;crp-mixture/Lambda-0</span>","value":"#'crp-mixture/Lambda-0"}
;; <=

;; **
;;; Sampling from the prior just to see how our prior looks like. Draw 100 data points from the prior.
;; **

;; @@
(defn to-colour-hex
  [value]
  (let
    [value (format "%X" value)]
    (if (= (.length value) 1)
      (str "0" value)
      value)))

(defn random-colour [] (str "#00" (to-colour-hex (rand-int 256)) (to-colour-hex (rand-int 256))))

(with-primitive-procedures
  [mvn-conjugate-fast random-colour]
  (defquery crp-mixture-prior
    "crp-mixture"
    []
    (let
      [ clusters (mem (fn clusters [id] (XRP (mvn-conjugate-fast mu-0 k-0 nu-0 Lambda-0))))
        clusters-colours (mem (fn clusters-colours [id] (random-colour)))
        my-crp (crp 1.0)
        points-assignments (mem (fn points-assignments [point-id] (my-crp)))]
      (predict
        :mypredict
        (map
          (fn [id]
            (list
              (SAMPLE (clusters (points-assignments id)))
              (clusters-colours (points-assignments id))
              ))
          (range 100))))))

(def points-with-colours (get (first (map get-predicts (doquery :lmh crp-mixture-prior []))) :mypredict)) 

(def common-range [[-5 5] [-5 5]])
  
(def plots
  (map
    (fn [x] (list-plot [(vec (first x))] :color (second x) :plot-range common-range :symbol-size 30 :opacity 0.5))
      points-with-colours))
        
(apply compose plots)

